interface ChartProps {
    list: Restaurant[];
}

interface Restaurant {
    name: string,
    location: {
        address1: string;
    };
    distance: number;
    url: string;
    }


const Chart: React.FC<ChartProps> = ({ list }) => {
    return (
        <div>
        <h2>Chart</h2>
        <table>
            <thead>
                <th>Name</th>
                <th>Address</th>
                <th>Distance</th>
                <th>Yelp Link</th>
            </thead>
            <tbody>
        {list.map((restaurant) => {
            const data = JSON.parse(restaurant);
            return (
                <tr>
                    <td>{data.name}</td>
                    <td>{data.location.address1}</td>
                    <td>{data.distance}</td>
                    <td><a href={data.url}>Yelp</a></td>
                </tr>
            )
        })}
        </tbody>
        </table>

        </div>
    );
}
export default Chart;
